import wells from "../APIs/wells"
import { CREATE_NEW_WELL } from "./types"

export default (wellInfo) => {
  return async dispatch => {
    console.log(wellInfo)
    const response = await wells.post('/wells', wellInfo)

    dispatch({type: CREATE_NEW_WELL, payload: response.data })
  }
}
